import React, { Component } from 'react';
import { Linkedin } from 'react-feather';
import { Instagram } from 'react-feather';
import { GitHub } from 'react-feather';
class Contact extends Component {
    render() {
        return (
            <div className="condiv">
            <h1 className="subtopic">Contact Me</h1>
            <ul className="contactList">
            <li><h3>Email  :  willhofkamp123@gmail.com</h3></li>
            <li><a className="socialLink" href="https://Linkedin.com/in/will-hofkamp-528603186" rel="noopener noreferrer"><Linkedin /></a></li>
            <li><a className="socialLink" href="https://github.com/WillHofkamp" rel="noopener noreferrer"><GitHub /></a></li>
            <li><a className="socialLink" href="https://Instagram.com/WillHofkamp" rel="noopener noreferrer"><Instagram /></a></li>
            </ul>
            </div>
            )
        }
    }

    export default Contact
